// Utility functions
export function getAvailableIcons(): IconData[] {
	return icons.filter(icon => icon.status === 'available');
}

export function getIconsByCategory(category: string): IconData[] {
	return icons.filter(icon => icon.category === category && icon.status === 'available');
}

export function getCategoriesWithCounts(): Record<string, number> {
	const categories: Record<string, number> = {};
	icons.forEach(icon => {
		if (icon.status === 'available') {
			categories[icon.category] = (categories[icon.category] || 0) + 1;
		}
	});
	return categories;
}

export function getTotalIconCount(): number {
	return icons.filter(icon => icon.status === 'available').length;
}

export function searchIcons(query: string): IconData[] {
	const lowercaseQuery = query.toLowerCase();
	return icons.filter(icon => {
		if (icon.status !== 'available') return false;
		
		return icon.name.toLowerCase().includes(lowercaseQuery) ||
			   icon.keywords.some(keyword => keyword.toLowerCase().includes(lowercaseQuery)) ||
			   icon.description.toLowerCase().includes(lowercaseQuery);
	});
}

export function getIconById(id: string): IconData | undefined {
	return icons.find(icon => icon.id === id && icon.status === 'available');
}

export function getIconByName(name: string): IconData | undefined {
	return icons.find(icon => icon.name === name && icon.status === 'available');
}
